Cast: Evan Stone, Manuel Ferrara, Asa Akira, Bobbi Starr, Charles Dera, Zoe Voss, Kate Kastle

Sexy, mischievous Asa Akira is a masseuse with a mission -- to bring every client to physical ecstacy. But head masseuse Bobbi Starr warns the Asian beauty against &quot;happy endings,&quot; despite her own weakness for older blonde lesbian Kate Kastle. When new girl Zoe Voss comes on board, Asa tells her to give the clients &quot;what they want,&quot; so Zoe gives Evan Stone a &quot;full body massage&quot; -and more. But when Zoe learns Asa's secret agenda, she turns the tables on the gorgeous vixen, and revenge has never been so sweet. Written and directed by Nica Noelle.
